Mon-El and Shadow Lass arrive at the prison facility known as Labyrinth to identify the corpse of Lars Hanscomb, better known to the Legion of Super-Heroes as Starfinger. However, a new Starfinger has arranged for the death of Lars Hanscomb and is running a criminal gang. The Legion soon learn of the new Starfinger's appearance when they take in a few criminals on another planet and Starfinger is mentioned. The Legion try to find a lead to follow the trail that would lead them to Starfinger.

